window.bookSummaryJSON = "<p>Based on the graphic novel series written by Olivier Legrand, J.B. Djian and illustrated by David Etien,<i> Baker Street Four</i> follows Billy (Charlie Brand), Charlie (Kiki May), and Tom (Nathan Moses), three young apprentices of Sherlock Holmes (Paterson Joseph) who assist the famous detective in London’s dodgy East End. With the help of their faithful cat, Watson (Bill Nighy) and Sherlock’s beloved housekeeper Mrs. Hudson (Celia Imrie), this foursome takes local crimes into their own hands while Holmes is off solving mysteries abroad. Follow the Baker Street Irregulars as they pursue different cases, growing by the day as young detectives and as friends. An Audible Original produced by Paradiso Media.</p> <p>Starring: Bill Nighy, Celia Imrie, Charlie Brand, Chipo Chung, Claudia Jolly,&nbsp;Connie Sweet, David Holt, David Robb, Finlay Paul, Harry Myers, Hazel Ellerby, Imogen Front, Joanna David, Jon Glover, Katja Quist, Luke , Michael Abayomi, Nikesh Patel, Paterson Joseph, Preeya Kalidas , Robert Glenister, Roger Watkins and Sam Dale.</p>"; 
